//import React, { useState } from "react";
import "./CommonLogin.css";

function CommonLogin({ setOpenModal }) {

  return (
    <>
       <div className="modal-background">
          <div className="model-container">
          <div className="titleCloseBtn">
          <button
            onClick={() => {
              setOpenModal(false);
            }}
          >
            X
          </button>
        </div>

             <div className="title"> <h1>Сіз кімсіз?</h1></div>
             <div className="body"> 
             <div className="card-group">
  
  <div className="card" style={{ marginLeft: '100px', marginRight: '100px', marginTop: '100px'}}>
    <img src={"https://static.vecteezy.com/system/resources/previews/005/519/978/original/cartoon-drawing-of-a-teacher-vector.jpg"} height="300px" width ="300px" className="card-img-top" alt="..."/>
    <div className="card-body">
      <h5 className="card-title">Мұғалім</h5>
    </div>
  </div>

  <div className="card" style={{ marginLeft: '100px', marginRight: '100px', marginTop: '100px'}}>
    <img src={"https://i.pinimg.com/736x/18/65/49/186549476b8aa1426ab2e627ce512ecb.jpg"} height="300px" width ="300px" className="card-img-top" alt="..."/>
    <div className="card-body">
      <h5 className="card-title">Студент</h5>
    </div>
  </div>

</div>
             </div>
        
          </div>
       </div>
  
     
    </>
  );
}

export default CommonLogin;
